import { useState } from 'react';
import Icon from '../../atoms/Icon'
import { Link } from 'react-router-dom'

const Cart = ({num})=> {
   
    
    return(

        <div className="cart" >
            <Link to='/cart'>

           <Icon classText='bx bx-cart'/>
           <div className="cart-entry" >{num}</div>
           </Link>
        </div>

    )
}

export default Cart;
